INSERT INTO `npc_text` SET `ID`=4995,`prob0`=1,`text0_0`='The Firelord and his brethren once held sway over this entire world, mortal. As a servant of the Old Gods, he fought against the Titans for domination of this planet. The victorious Titans banished my master and his brethren to the Elemental Plane - there to remain imprisoned until the end of time.',`text0_1`='',`lang0`=0,`em0_0`=0,`em0_1`=0,`em0_2`=0,`em0_3`=0,`em0_4`=0,`em0_5`=0;
INSERT INTO `npc_text` SET `ID`=5011,`prob0`=1,`text0_0`='A mere three hundred years ago, a reckless dwarf named Thaurissan summoned the master from his fiery realm. His return to this paltry world devastated the surrounding lands and created this volcanic Core. Mighty Ragnaros has slept under this mountain ever since. 
INSERT INTO `npc_text` SET `ID`=5012,`prob0`=1,`text0_0`='We, his sworn servants, do his bidding and enforce his iron-rule. Cut off from the energies of his fiery realm, Ragnaros is but a shadow of his true self. However, he has more than enough strength to be your end.      
INSERT INTO `npc_text` SET `ID`=14736,`prob0`=1,`text0_0`='There are some who desire to stop gaining experience from their actions; to forever remain at the level of strength they are now, and never grow stronger.$B$BI can make this possible... for a fee, of course.$B$BBut understand this: Once you pay me, you will NO LONGER GAIN EXPERIENCE. None. Not one whit.$B$BShould you change your mind afterwards and want to start gaining experience again, I can undo the process for the same fee.',`text0_1`='There are some who desire to stop gaining experience from their actions; to forever remain at the level of strength they are now, and never grow stronger.$B$BI can make this possible... for a fee, of course.$B$BBut understand this: Once you pay me, you will NO LONGER GAIN EXPERIENCE. None. Not one whit.$B$BShould you change your mind afterwards and want to start gaining experience again, I can undo the process for the same fee.',`lang0`=0,`em0_0`=0,`em0_1`=1,`em0_2`=0,`em0_3`=0,`em0_4`=0,`em0_5`=0;
