INSERT INTO `npc_text` SET `ID`=14023,`prob0`=1,`text0_0`='The Steamwheedle Cartel hosts an entire arena circuit in the central sewers of Dalaran.$B$BYou''ll find dueling rings there, too, at the Circle of Wills.',`text0_1`='The Steamwheedle Cartel hosts an entire arena circuit in the central sewers of Dalaran.$B$BYou''ll find dueling rings there, too, at the Circle of Wills.',`lang0`=0,`em0_0`=0,`em0_1`=1,`em0_2`=0,`em0_3`=0,`em0_4`=0,`em0_5`=0;
INSERT INTO `npc_text` SET `ID`=14793,`prob0`=1,`text0_0`='',`text0_1`='Justicar Mariel Trueheart has asked us to see to the needs of the tournament. Those who have earned the right to stand as champions and who have proven themselves in our eyes are asked to assist with these duties.',`lang0`=0,`em0_0`=0,`em0_1`=0,`em0_2`=0,`em0_3`=0,`em0_4`=0,`em0_5`=0;
INSERT INTO `npc_text` SET `ID`=14669,`prob0`=1,`text0_0`='You are not yet strong enough to do battle on the Isle of Conquest. Return when you have gained more experience.',`text0_1`='You are not yet strong enough to do battle on the Isle of Conquest. Return when you have gained more experience.',`lang0`=0,`em0_0`=1,`em0_1`=274,`em0_2`=0,`em0_3`=0,`em0_4`=0,`em0_5`=0;
INSERT INTO `npc_text` SET `ID`=14543,`prob0`=1,`text0_0`='',`text0_1`='Can you feel it?$B$BThe spirit world draws close during the Day of the Dead. This is why we decorate the graves of our dearly departed with flowers and candles and offerings: To welcome them back, even if only for a time.$B$BSo come! Dance with me! Let us cherish and honor those we have lost in their ghostly presence, so that they might eat and drink and smile and know that they are loved.',`lang0`=0,`em0_0`=0,`em0_1`=0,`em0_2`=0,`em0_3`=0,`em0_4`=0,`em0_5`=0;
INSERT INTO `npc_text` SET `ID`=14552,`prob0`=1,`text0_0`='It''s good to visit with friends and family again, celebrating and sharing stories of old.',`text0_1`='It''s good to visit with friends and family again, celebrating and sharing stories of old.',`lang0`=0,`em0_0`=0,`em0_1`=396,`em0_2`=0,`em0_3`=0,`em0_4`=0,`em0_5`=0;
